var path = [];
const X_LENGTH = rawDataField[0].length;
const Y_LENGTH = rawDataField.length;
const EMPTY = 0;
const BLOCK = 1;
const VOID = 2;

function initialize() {
	var x, y;
	var blockCoors = [];
	var stripPhase = 0;
	gData.field = [];
	for (x = 0 ; x < X_LENGTH ; x++) {
		gData.posByColumns.push({yMin : -1, yMax : -1});
	}
	for (y = 0 ; y < Y_LENGTH ; y++) {
		gData.posByRows.push({xMin : -1, xMax : -1});		
	}
	for (y = 0 ; y < Y_LENGTH ; y++) {
		gData.field.push([]);
		voidNess = false;
		stripPhase = 0;
		gData.field.push([]);
		for (x = 0 ; x < X_LENGTH ; x++) {
			gData.field[y].push([]);
			if (rawDataField[y][x] == '#') {
				voidNess = true;
				gData.field[y][x] = ({kind : BLOCK});
				blockCoors.push({x : x, y : y});
				if (gData.posByColumns[x].yMin == -1) {
					gData.posByColumns[x].yMin = y;
				}
				if (gData.posByRows[y].xMin == -1) {
					gData.posByRows[y].xMin = x;
				}
			} else if (rawDataField[y][x] == '.') {
				voidNess = true;
				gData.field[y][x] = ({
					kind : EMPTY,
					nextBlock : [-1, -1, -1, -1], // The distance you have to walk before meeting the next one (-1 if infinity)
				});
				if (gData.posByColumns[x].yMin == -1) {
					gData.posByColumns[x].yMin = y;
				}
				if (gData.posByRows[y].xMin == -1) {
					gData.posByRows[y].xMin = x;
				}
			} else {
				gData.field[y][x] = ({kind : VOID});
				if (gData.posByColumns[x].yMin != -1 && gData.posByColumns[x].yMax == -1) {
					gData.posByColumns[x].yMax = y-1;
				}
				if (gData.posByRows[y].xMin != -1 && gData.posByRows[y].xMax == -1) {
					gData.posByRows[y].xMax = x-1;
				}
			}
		}
	}
	for (x = 0 ; x < X_LENGTH ; x++) {
		if (gData.posByColumns[x].yMax == -1) {
			gData.posByColumns[x].yMax = Y_LENGTH-1;
		}
	}
	for (y = 0 ; y < Y_LENGTH ; y++) {
		if (gData.posByRows[y].xMax == -1) {
			gData.posByRows[y].xMax = X_LENGTH-1;
		}
	}
	
	// Calculate all distances
	var xx, yy, count;
	blockCoors.forEach(coors => {
		x = coors.x;
		y = coors.y;
		yy = y;
		xx = x-1;
		if (xx == gData.posByRows[y].xMin-1) {
			xx = gData.posByRows[y].xMax;
		}
		count = 0;
		while (gData.field[yy][xx].kind == EMPTY && gData.field[yy][xx].nextBlock[DIRECTION.RIGHT] == -1) {
			gData.field[yy][xx].nextBlock[DIRECTION.RIGHT] = count;
			count++;
			xx--;
			if (xx == gData.posByRows[y].xMin-1) {
				xx = gData.posByRows[y].xMax;
			}
		}
		xx = x+1;
		count = 0;
		if (xx == gData.posByRows[y].xMax+1) {
			xx = gData.posByRows[y].xMin;
		}
		while (gData.field[yy][xx].kind == EMPTY && gData.field[yy][xx].nextBlock[DIRECTION.LEFT] == -1) {
			gData.field[yy][xx].nextBlock[DIRECTION.LEFT] = count;
			count++;
			xx++;
			if (xx == gData.posByRows[y].xMax+1) {
				xx = gData.posByRows[y].xMin;
			}
		}
		
		xx = x;
		yy = y-1;
		count = 0;
		if (yy == gData.posByColumns[x].yMin-1) {
			yy = gData.posByColumns[x].yMax;
		}
		while (gData.field[yy][xx].kind == EMPTY && gData.field[yy][xx].nextBlock[DIRECTION.DOWN] == -1) {
			gData.field[yy][xx].nextBlock[DIRECTION.DOWN] = count;
			count++;
			yy--;
			if (yy == gData.posByColumns[x].yMin-1) {
				yy = gData.posByColumns[x].yMax;
			}
		}
		yy = y+1;
		count = 0;
		if (yy == gData.posByColumns[x].yMax+1) {
			yy = gData.posByColumns[x].yMin;
		}
		while (gData.field[yy][xx].kind == EMPTY && gData.field[yy][xx].nextBlock[DIRECTION.UP] == -1) {
			gData.field[yy][xx].nextBlock[DIRECTION.UP] = count;
			count++;
			yy++;
			if (yy == gData.posByColumns[x].yMax+1) {
				yy = gData.posByColumns[x].yMin;
			}
		}
	});
}

